import React, { Component } from 'react';
import "./Header.css";

export default class Header extends Component {
  render() {
    return (
      <div id="jumbotronMain" class="jumbotron jumbotron-fluid">
      <div class="container">
        <h1 class="display-4 d-flex justify-content-center">Welcome to Questival!</h1>
        <div class="blurb">
          <p>Questival is designed to connect fellow attendees with
            events that are tailored to their own personal interests. Create an account, add your interests and
            view
            events that align with what YOU care about. You will also be able to see other attendees that are
            going
            to those same events that share your interests! </p>
        </div>
      </div>
      </div>
    )
  }
}
